import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Slider from './components/Slider';
import EventAdvertisement from './components/EventAdvertisement';
import AboutHome from './components/AboutHome';
import EventGalleryHome from './components/EventGalleryHome';
import EventExpertiseHome from './components/EventExpertiseHome';
import SpeakerHome from './components/SpeakerHome';
import TestoHome from './components/TestoHome';
import OffersHome from './components/OffersHome';
import EventsHome from './components/EventsHome';
import NewsHome from './components/NewsHome';
function App() {
  return (
    <div className="App">
       <Header/>
       <Slider/>
       <EventAdvertisement/>
       <AboutHome/>
       <EventGalleryHome/>
       <EventExpertiseHome/>
       <SpeakerHome/>
       <TestoHome/>
       <OffersHome/>
       <EventsHome/>
       <NewsHome/>
    </div>
  );
}

export default App;
